var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Maison","text":"<p>Bonjour le monde \ud83d\ude0a</p> <p></p> <p>Bienvenue sur notre site \ud83e\udd17</p>"},{"location":"About%20us.html","title":"A propos de nous","text":"<p>Bonjour ! Nous sommes la Startup World's Innovation. Technicien en formation  en G\u00e9nie \u00c9lectrique et Automatisation Industrielle, bas\u00e9 \u00e0 Yamoussoukro, en C\u00f4te d\u2019Ivoire. Actuellement, Nous sommes \u00e0 l\u2019 Institut Polytechnique F\u00e9lix Houphou\u00ebt-Boigny (INP-HB) en tant qu'\u00e9tudiant et suivons des cours \u00e0 INPHB Lab. Passionn\u00e9 par l\u2019innovation, la fabrication num\u00e9rique et la formation des futurs ing\u00e9nieurs, Nous mettons nos comp\u00e9tences au service de la technologie et de la cr\u00e9ativit\u00e9.</p> <p>Visitez notre site pour d\u00e9couvrir nos r\u00e9alisations !\ud83d\udc95</p>"},{"location":"Remerciements.html","title":"Remerciements","text":"<p>Nous tenons \u00e0 exprimer notre profonde gratitude \u00e0 l'ensemble des enseignants-chercheurs qui nous ont accompagn\u00e9s tout au long de notre parcours acad\u00e9mique au sein de l'Institut National Polytechnique F\u00e9lix Houphou\u00ebt-Boigny (INP-HB), et plus particuli\u00e8rement au corps professoral de l'\u00c9cole Sup\u00e9rieure d'Industrie (ESI), dont l'engagement ind\u00e9fectible a \u00e9t\u00e9 d\u00e9terminant dans la qualit\u00e9 de notre formation.</p>"},{"location":"Remerciements.html#remerciements-particuliers","title":"Remerciements particuliers :","text":"<ul> <li> <p>\u00c0 Monsieur Jean-Nicaise Akaffou, pour son encadrement rigoureux, son suivi attentif et ses pr\u00e9cieux conseils tout au long de ce projet.  </p> </li> <li> <p>\u00c0 l'\u00e9l\u00e8ve encadreur Kon\u00e9 Zi\u00e9 Soul\u00e9ymane, pour son accompagnement constant et ses orientations avis\u00e9es durant cette r\u00e9alisation.</p> </li> </ul>"},{"location":"Remerciements.html#temoignages-de-reconnaissance","title":"T\u00e9moignages de reconnaissance :","text":"<p>Nous exprimons \u00e9galement notre sinc\u00e8re reconnaissance \u00e0 :  </p> <ul> <li> <p>Dr Moussa Kader Diaby, Directeur G\u00e9n\u00e9ral de l'INP-HB, dont le leadership visionnaire contribue au rayonnement international de notre institution ;  </p> </li> <li> <p>Dr Adama Ouattara, Directeur de l'\u00c9cole Sup\u00e9rieure d'Industrie, pour son d\u00e9vouement \u00e0 l'excellence acad\u00e9mique ;  </p> </li> <li> <p>Nos chers parents, pour leur soutien inconditionnel et leur affection sans faille ;</p> </li> <li> <p>L'ensemble de nos professeurs, sans lesquels la concr\u00e9tisation de ce projet n'aurait pu \u00eatre possible ;  </p> </li> <li> <p>Tous les \u00e9tudiants du D\u00e9partement de G\u00e9nie \u00c9lectrique, ainsi qu'\u00e0 toutes les personnes qui, de pr\u00e8s ou de loin, ont contribu\u00e9 \u00e0 la r\u00e9ussite de ce travail ;  </p> </li> <li> <p>Les laboratoires partenaires \u2013 PNUD, Yello Lab et Akuna Lab \u2013 pour nous avoir accueillis et mis \u00e0 disposition les \u00e9quipements n\u00e9cessaires \u00e0 la r\u00e9alisation de nos projets.</p> </li> </ul> <p></p>"},{"location":"Projets/Projet%201.html","title":"Projet 1","text":""},{"location":"Projets/Projet%201.html#partie-a-realisation-du-pcb","title":"Partie A : R\u00e9alisation du PCB","text":""},{"location":"Projets/Projet%201.html#1-creation-du-projet-et-ouverture-de-lediteur-schematique","title":"1-Cr\u00e9ation du projet et Ouverture de l\u2019\u00e9diteur Sch\u00e9matique","text":"<p>Ouvrir le logiciel Kicad, aller dans l\u2019onglet fichiers puis cliquez sur nouveau projet. Ensuite nommer votre projet et enregistrez-le. Le contenu du dossier s\u2019affichera sur l\u2019interface du logiciel en haut \u00e0 gauche, faire un clic gauche sur l\u2019\u00e9diteur sch\u00e9matique pour l\u2019ouvrir.</p> <p></p> <p></p> <p></p> <p>Apr\u00e8s avoir cliqu\u00e9 sur l'\u00e9diteur sch\u00e9matique, on se retrouve avec l'interface suivant.</p> <p></p>"},{"location":"Projets/Projet%201.html#2-realisation-du-schema-de-cablage-du-pcb","title":"2-R\u00e9alisation du sch\u00e9ma de c\u00e2blage du PCB","text":"<p>Pour la r\u00e9alisation de notre circuit imprim\u00e9 il a \u00e9t\u00e9 utilis\u00e9 les symboles (composants) suivants :</p> <p>-Un microcontr\u00f4leur ATmega 328P</p> <p>-Un Quartz de 16 MHZ</p> <p>-Une r\u00e9sistance de 10 k\u038f et une de 220 \u038f</p> <p>-Une r\u00e9sistance de 100 nF</p> <p>-Des broches</p> <p>-Condensateurs de 22pF</p> <p>-Une LED</p> <p>-Un bouton poussoir</p> <p>-Un module USB</p>"},{"location":"Projets/Projet%201.html#a-ajout-dun-symbole-composant","title":"a-Ajout d\u2019un symbole (composant)","text":""},{"location":"Projets/Projet%201.html#comment-ajouter-les-composants","title":"Comment ajouter les composants ?","text":"<p>Le processus est d\u00e9crit par les deux images successives ci-dessous. Faire un clic gauche sur les zones encadr\u00e9es en rouges. Une fois que vous cliquez sur le symbole \u00ab Ajouter un symbole \u00bb, une fen\u00eatre s\u2019ouvre. Dans la barre de recherche de cette fen\u00eatre enter le nom du composant recherche puis s\u00e9lectionnez le pamis la liste des \u00e9l\u00e9ments affich\u00e9s. Une fois le composant s\u00e9lectionn\u00e9 appuyer sur OK puis clic gauche avec la souris pour fixer le composant. R\u00e9p\u00e9ter le processus pour tous les composants (symboles) \u00e0 ajouter.</p> <p></p> <p></p> <p></p>"},{"location":"Projets/Projet%201.html#b-connection-des-composants-symboles-et-annotation-des-pattes","title":"b-Connection des composants (symboles) et Annotation des pattes","text":"<p>Cliquez sur l\u2019\u00e9l\u00e9ment encadr\u00e9 en rouge puis clic gauche sur les pattes des diff\u00e9rents symboles l\u2019un vers l\u2019autre pour les connecter NB : Les pattes sont les \u00e9l\u00e9ments entour\u00e9s en orange</p> <p></p>"},{"location":"Projets/Projet%201.html#c-comment-annoter-les-pattes-ajout-label-des-symboles","title":"C- Comment annoter les pattes (Ajout Label) des symboles ?","text":"<p>Suivre le processus indiqu\u00e9 sur l\u2019image par la fl\u00e8che et les \u00e9l\u00e9ments encadr\u00e9s. Commencer par l\u2019\u00e9l\u00e9ment encadr\u00e9 en rouge \u00e0 droite \u00ab Ajout Label \u00bb en faisant un clic gauche</p> <p></p> <p>Apr\u00e8s le clic sur le OK de la fen\u00eatre qui s\u2019est ouverte ci-dessus, faire clic gauche pour d\u00e9poser le Label devant composant o\u00f9 la connexion aura lieu puis relier.</p> <p>On sait maintenant relier n\u2019est-ce pas ? \ud83d\ude0a</p> <p></p> <p>Voici ce que l\u2019on obtient</p> <p></p>"},{"location":"Projets/Projet%201.html#3-affectation-des-empreintes","title":"3-Affectation des empreintes","text":"<p>Pour notre projet voici les empreintes utilis\u00e9es</p> <p></p>"},{"location":"Projets/Projet%201.html#comment-assigner-les-empreintes","title":"Comment assigner les empreintes ?","text":"<p>Appuyer sur \u00ab l\u2019ic\u00f4ne assigner empreintes \u00bb : l\u2019\u00e9l\u00e9ment encadr\u00e9 en rouge puis suivre les \u00e9tapes indiqu\u00e9es sur les images qui suivent.</p> <p></p> <p></p> <p></p> <p>Visualisation 3D de l\u2019empreinte</p> <p></p> <p>Appuyer sur OK juste en bas a droite de la fen\u00eatre pour enregistrer</p>"},{"location":"Projets/Projet%201.html#4-commutation-a-lediteur-pcb-et-organisation","title":"4-Commutation \u00e0 l\u2019\u00e9diteur PCB et Organisation","text":"<p>Faire un clic gauche sur l\u2019\u00e9diteur de PCB pour l\u2019ouvrir</p> <p></p> <p></p> <p></p> <p>Une fois la mise \u00e0 jour du PCB fait, organiser les symbols dans ce ordre</p> <p></p> <p></p>"},{"location":"Projets/Projet%201.html#parametrage-de-lepaisseur-des-pistes","title":"Param\u00e9trage de l\u2019\u00e9paisseur des pistes","text":"<p>Dans le cadre de notre projet nous avons utilis\u00e9 comme \u00e9paisseur de piste 0.4 mm</p> <p></p>"},{"location":"Projets/Projet%201.html#comment-tracer-les-pistes","title":"Comment tracer les pistes ?","text":"<p>S\u00e9lectionner la couche \u00ab B.cu \u00bb puis suivre le processus comme indiqu\u00e9 sur l\u2019image Pour annuler une action appuyer sur la touche esc du clavier</p> <p></p>"},{"location":"Projets/Projet%201.html#comment-realiser-le-cadrage","title":"Comment r\u00e9aliser le cadrage ?","text":"<p>S\u00e9lectionner \u00ab Edge cuts \u00bb :  permet de dimensionner notre PCB Cliquez sur le petit carr\u00e9 \u00e0 droite encadr\u00e9 en rouge pour tracer le rectangle puis dans la suite faire double clic sur une ligne du rectangle pour modifier les param\u00e8tres du rectangle. On prendra 0.8 mm comme largeur de ligne</p> <p></p> <p>On obtient :</p> <p></p> <p></p> <p>Des actions de l\u2019image pr\u00e9c\u00e9dente d\u00e9coule celle-ci donnant un visuel 3D de notre PCB \ud83d\udc47</p> <p></p>"},{"location":"Projets/Projet%201.html#enegistrement-sous-fichier-svg","title":"Enegistrement sous fichier svg","text":"<p>Cocher les memes cases comme indiqu\u00e9e sur l'image.</p> <p></p>"},{"location":"Projets/Projet%201.html#video-de-prise-en-main-du-logiciel-kicad","title":"Video de prise en main du logiciel KICAD","text":"<p>L'objectif de cette vid\u00e9o est de nous permettre d'avoir les bases necessaires afin de  r\u00e9aliser les \u00e9tapes ci-dessus. CLIQUEZ SUR L'IMAGE \ud83d\udc47\ud83d\udc47</p> <p></p>"},{"location":"Projets/Projet%202.html","title":"Projet 2","text":""},{"location":"Projets/telechargement.html","title":"T\u00e9l\u00e9chargement des fichiers","text":"<p>Le document compress\u00e9 MONMICRO(2) contient tous les fichiers Kicad de r\u00e9alisation du PCB ainsi que les fichiers svg.</p> <p>Pour t\u00e9l\u00e9charger le document, cliquez sur le lien ci-dessous :  </p> <p>\ud83d\udce5 T\u00e9l\u00e9charger le fichier ZIP (Taille : 439 Ko)</p>"}]}